import './Search.css'
import Searchbutton from '../buttons';

const SearchBar = (props) => {
    return (
        <form action="#" className='search'>
            <input type="text" placeholder={props.children} name='search'/>
            <Searchbutton></Searchbutton>
        </form>       
    )
};

export default SearchBar;
